import React, { Component } from 'react';
import { NavLink, Redirect } from 'react-router-dom';

import web3 from '.././web3';
import contract from '.././contract';


class Home extends Component {
  state = {
    redirectTo: 5,
    isAddDataMode: false, // Track whether it's in "Add data" mode
  };

  async handleMetamaskLogin() {
	try {
	  // Enable Metamask provider
	  await window.ethereum.enable();

	  // Get Metamask accounts
	  const accounts = await web3.eth.getAccounts();

	  // Call your contract's Identify method
	  await contract.methods.Identify().call({ from: accounts[0] }, (error, result) => {
		if (error) {
		  console.error('Contract call error:', error);
		} else {
		  this.setState({ redirectTo: result });
		  console.log(result);
		}
	  });
	} catch (error) {
	  console.error('Metamask login error:', error);
	}
  }



  render() {
    return (
      <div id="home-body">
        <br />
        <br />
        <br />
        <br />
        <h2>Sign Up via Metamask</h2>
        {!this.state.isAddDataMode ? (
          <div>
            <button
              onClick={() => this.setState({ isAddDataMode: true })}
              className="btn btn-primary"
            >
              <h4>Add Data</h4>
            </button>
            <br />
            <button
              onClick={() => this.setState({ redirectTo: 0 })}
              className="btn btn-primary"
            >
              <h4>View Data</h4>
            </button>
          </div>
        ) : (
			<div>
            <div>
              <NavLink to="/doctor" className="btn btn-primary">
                <h4>As a Patient</h4>
              </NavLink>
            </div>
            <br />
            <div>
              <NavLink to="/newdoctor" className="btn btn-primary">
                <h4>As a Doctor</h4>
              </NavLink>
            </div>
            <br />
            <div>
              <NavLink to="/newinsurancecompany" className="btn btn-primary">
                <h4>As an Insurance Company</h4>
              </NavLink>
            </div>
            <br />
            <div>
              <NavLink to="/newchemist" className="btn btn-primary">
                <h4>As a Chemist</h4>
              </NavLink>
            </div>
            <br />
            <button
              onClick={() => this.setState({ isAddDataMode: false })}
              className="btn btn-primary"
            >
              <h4>Back</h4>
            </button>
          </div>
        )}
        <h2>Already registered?</h2>
        <button onClick={() => this.handleMetamaskLogin()} className="btn btn-primary">
          <h4>Login via Metamask</h4>
        </button>
        {this.state.redirectTo === 1 ? <Redirect to="/patient" /> : <span></span>}
        {this.state.redirectTo === 2 ? <Redirect to="/doctor" /> : <span></span>}
        {this.state.redirectTo === 3 ? <Redirect to="/insurancecompany" /> : <span></span>}
        {this.state.redirectTo === 4 ? <Redirect to="/chemist" /> : <span></span>}
        {this.state.redirectTo === 0 ? (
          <div>
            <h4 className="yf">Please Login via Metamask.</h4>
          </div>
        ) : (
          <span></span>
        )}
      </div>
    );
  }
}

export default Home;

